import React from 'react';
import backgroundImage from './FAM.png';

function BackgroundImage() {
  const backgroundImageStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundPosition: 'center',
    backgroundSize: 'contain',
    backgroundRepeat: 'no-repeat',
    width: '700px',  // Justera bredden efter önskemål
    height: '450px', // Justera höjden efter önskemål
    position: 'fixed',
    bottom: '10px',  // Justera avståndet från botten
    right: '1px',   // Justera avståndet från höger sida
    zIndex: -1,      // Bilden ligger under andra element
    display: 'flex', // Använd flexbox för att centrera texten
    justifyContent: 'center',
    alignItems: 'flex-start', // Justerar så att innehållet alignas mot början av container (i detta fall toppen)
  };

  const textStyle = {
    color: 'white', // Vit text
    fontSize: '24px', // Storlek på texten
    marginTop: '100px', // Lägg till detta för att skapa utrymme ovanför texten
  };

  return (
    <div style={backgroundImageStyle}>
      <span style={textStyle}>Din Text Här</span>
    </div>
  );
}

export default BackgroundImage;
